import { useState, useEffect } from 'react';
import { useAuth } from '../context/AuthContext';
import { Link } from 'react-router-dom';

function ListerDashboard() {
  const { user } = useAuth();
  const [listings, setListings] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchListings = async () => {
      try {
        const token = localStorage.getItem('token');
        const response = await fetch(`http://localhost:5001/api/listers/${user.username}/listings`, {
          headers: {
            'Authorization': `Bearer ${token}`
          }
        });

        if (!response.ok) {
          throw new Error('Failed to fetch listings');
        }

        const data = await response.json();
        setListings(data.listings || []);
        setError(null);
      } catch (err) {
        console.error('Error fetching listings:', err);
        setError('No listings found. Create your first listing to get started!');
      } finally {
        setLoading(false);
      }
    };

    fetchListings();
  }, [user.username]);

  if (loading) {
    return (
      <div className="min-h-screen bg-gray-50 flex items-center justify-center">
        <div className="text-gray-600">Loading...</div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gray-50 py-12">
      <div className="container mx-auto px-4 max-w-6xl">
        <div className="bg-white rounded-2xl shadow-xl p-8">
          <div className="flex justify-between items-center mb-8">
            <h1 className="text-2xl font-bold text-gray-800">Lister Dashboard</h1>
            <Link
              to="/listings/new"
              className="bg-blue-600 text-white px-4 py-2 rounded-lg hover:bg-blue-700 transition-colors"
            >
              Add New Listing
            </Link>
          </div>

          {/* Listings Overview */}
          <div className="mb-8">
            <h2 className="text-xl font-semibold text-gray-800 mb-4">Your Listings</h2>
            {listings.length === 0 ? (
              <div className="text-gray-600 text-center py-8">
                <p>You haven't created any listings yet.</p>
                <Link
                  to="/listings/new"
                  className="text-blue-600 hover:text-blue-800 font-medium"
                >
                  Create your first listing
                </Link>
              </div>
            ) : (
              <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
                {listings.map((listing, index) => (
                  <div
                    key={index}
                    className="border rounded-lg p-4 hover:shadow-md transition-shadow"
                  >
                    <h3 className="font-medium mb-2">${listing.rent}/month</h3>
                    <p className="text-sm text-gray-600 mb-2">
                      {listing.numberOfRooms} rooms • {listing.numberOfBathrooms} baths • {listing.squareFoot} sq ft
                    </p>
                    <p className="text-sm text-gray-600 mb-4">
                      {listing.description?.substring(0, 100)}...
                    </p>
                    <div className="flex justify-between items-center">
                      <span className="text-sm text-gray-500">
                        {listing.distanceFromUniv} miles from university
                      </span>
                      <Link
                        to={`/listings/${index}/edit`}
                        className="text-blue-600 hover:text-blue-800"
                      >
                        Edit
                      </Link>
                    </div>
                  </div>
                ))}
              </div>
            )}
          </div>

          {/* Quick Stats */}
          <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
            <div className="bg-gray-50 rounded-lg p-6">
              <h3 className="text-lg font-medium mb-2">Total Listings</h3>
              <p className="text-3xl font-bold text-blue-600">{listings.length}</p>
            </div>
            <div className="bg-gray-50 rounded-lg p-6">
              <h3 className="text-lg font-medium mb-2">Average Price</h3>
              <p className="text-3xl font-bold text-blue-600">
                ${listings.length > 0 
                  ? Math.round(listings.reduce((acc, curr) => acc + curr.rent, 0) / listings.length)
                  : 0}
              </p>
            </div>
            <div className="bg-gray-50 rounded-lg p-6">
              <h3 className="text-lg font-medium mb-2">Active Listings</h3>
              <p className="text-3xl font-bold text-blue-600">{listings.length}</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default ListerDashboard;
